namespace IDEClient
{
    class Program
    {
        private NetworkStream ns;
        private Thread thread;
        private TcpClient client;

        public Program(string ip, int port)
        {
            connect(ip, port);
            
            //start();
            if (ns == null)
            {
                connect(ip, port + 1);
                return;
            }

        }

        private void connect(string ip, int port)
        {
            try
            {
                client = new TcpClient(ip, port);
                ns = client.GetStream();
            }
            catch
            {
                //connect(ip, port + 1);
            }
            
            Console.WriteLine("ip : " + ip, "  port : "+ port + "연결 성공");
        }

        private void sendLine(string m)
        {
            StreamWriter sw = new StreamWriter(ns);
            sw.Write(m+"\n");
            sw.Flush();
            Console.Write(m);
        }

        public static string GetLocalIPAddress()
        {
            var host = Dns.GetHostEntry(Dns.GetHostName());
            foreach (var ip in host.AddressList)
            {
                if (ip.AddressFamily == AddressFamily.InterNetwork)
                {
                    return ip.ToString();
                }
            }
            throw new Exception("No network adapters with an IPv4 address in the system!");
        }

        public void LoadModel(string data)
        {
            string temp = data;
            temp = temp.Replace(Environment.NewLine, "");
            temp = temp.Replace("\t", " ");
            temp = temp.Replace(" ", "");


            string sendData = "{\"messageType\" : \"load\", \"message\" :" + temp + "}";
            this.sendLine(sendData);
        }
        public void UpdataInstance(string data)
        {
            string temp = data;
            temp = temp.Replace(Environment.NewLine, "");
            temp = temp.Replace(" ", "");
            temp = temp.Replace("\t", "");
            string sendData = "{\"messageType\" : \"update\", \"message\" :" + temp + "}";
            this.sendLine(sendData);
        }

